description:
Эко сумка (шоппер) - альтернативная замена полиэтиленовым пакетам и красивое решение;
Сумка сделана из плотной ткани и прослужит вам очень долго;
С нашей эко сумкой вы всегда будете оригинальными и неповторимыми;
По желанию можно изменить текст, рисунок или цвет нанесения;
А также можем сделать с любым вашим принтом.

description_en:
Eco bag (shopper) - an alternative replacement for polyethylene bags and a beautiful solution;
The bag is made of thick fabric and will last you a very long time;
With our eco bag you will always be original and unique;
If you wish, you can change the text, picture or color of the application;
And we can also do it with any of your prints.

description:
«Вішенка» від Гуся це блокнот-планер, тому тут є всі необхідні інструменти планування у першокласному виконанні:

тверда обкладинка з матовою ламінацією й вибірковим лаком та якісний папір молочного кольору;
100 міні-ілюстрацій з іронічним Гусем ексклюзивно для цього планера;
блоки для планування на день, місяць, рік;
календар на 2022–2025 роки;
місце для нотаток;
трекер звичок;
набір наклейок;
вбудований конверт;
стрічка-закладка та стрейч-стрічка (резинка);
простір для твоїх ідей — сторінки в світлу крапку;
яскраві вставки-малюнки з Гусьом між блоками.
За яскравою обкладинкою ховається справжній Гусь у всій своїй іронічній та прямолінійній красі. За словом він в кишеню не полізе, інколи й за міцним. Тож планер 18+ і не підійде надто чутливим особам.

description_en:
"Vishenka" from Gusy is a notebook-planner, so it has all the necessary planning tools in a first-class performance:

hardcover with matte lamination and selective varnish and high-quality milk-colored paper;
100 ironic Goose mini-illustrations exclusive to this glider;
blocks for planning for the day, month, year;
calendar for 2022-2025;
space for notes;
habit tracker;
a set of stickers;
built-in envelope;
bookmark tape and stretch tape (rubber band);
space for your ideas - pages with a bright dot;
bright inserts-pictures with Goose between the blocks.
He won't dig into his pocket for his word, sometimes even for a strong one. So the glider is 18+
